			/* Misc */
			function checkNull(item, backupItem) {
				return item != null ? item : backupItem;
			}

			// param variables
			var _device = 'UBKD334F21E-3C23-11E5-8494-C3AD4A89321E';
			var _name = 'Silo1';
			var _as = 578;
			var _ds = 340;
			var _cs = 204;
			var _od = 68;
			var _d = 680;
			var _loaded = false;

			/* Param Events */
			function loadParams() {
				var widget = svidget.$;
				_device = checkNull(widget.param("deviceNumber").value(), _device);
				_name = checkNull(widget.param("nameSilo").value(), _name);
				_as = checkNull(widget.param("alcadaSilo").value(), _as);
				console.log(_as);
				_ds = checkNull(widget.param("diametreSilo").value(), _ds);
				_cs = checkNull(widget.param("ConeSilo").value(), _cs);
				_od = checkNull(widget.param("OffsetDevice").value(), _od);
				_d = checkNull(widget.param("Densitat").value(), _d);
			}

		// this handler is invoked when params Update is set
		function handleUpdateParamSet(e) {
			if (!_loaded) return;
			console.log('handleLabelParamsSet');
			var widget = svidget.$;
			loadParams();

			/* This websocket sends homogenous messages in the form
	         * {timestamp: 1234567, analog: {percentage: 3.3, capacity: 2.3, weight: 20, volume: 20}}
	         * where timestamp is a Unix timestamp
	         */
	        json_ws(function(data) {
				// Access
				console.log('New data...');
				Snap("#ubkName").select("tspan").node.innerHTML = "#"+_name;			
				Snap("#ubkAvailable").select("tspan").node.innerHTML = data.analog["percentage"] + '%';					
				Snap("#ubkCapacity").select("tspan").node.innerHTML = data.analog["capacity"] + 'm&#179;';					
				Snap("#ubkContent").select("tspan").node.innerHTML = data.analog["weight"] +'Kg';					
				Snap("#ubkVolume").select("tspan").node.innerHTML = data.analog["volume"] + '0m&#179;';					

				updateSiloLevels(data.analog["percentage"]);
	        });										
		}


		function waitTillLoaded() {
			// this is temp hack to give chance for page to pass params, if no page then we are in standalone mode
			window.setTimeout(function () {
				if (svidget.$.populatedFromPage()) return;			
				}, 100);	
		}

