			}	
			window.addEventListener('load', init, false);	

			/* Connect to backend and open websocked */
	    	function json_ws( on_msg ) {
					console.log('Connecting...');
			        if (!("WebSocket" in window)) {
			            alert("Use a browser supporting websockets");
			        }
				  console.log("ws://localhost:8081/ws?device="+_device+"&as="+_as+"&ds="+_ds+"&cs="+_cs+"&od="+_od+"&d="+_d);
					var conn = new WebSocket("ws://localhost:8081/ws?device="+_device+"&as="+_as+"&ds="+_ds+"&cs="+_cs+"&od="+_od+"&d="+_d);
					//var conn = new WebSocket("ws://localhost:8081/ws?device=UBKD334F21E-3C23-11E5-8494-C3AD4A89321E&as=578&ds=340&cs=204&od=68&d=680.0");

			              conn.onclose = function(evt) {
								console.log('Connection closed.');
//			                  document.getElementById("fileData").textContent = 'Connection closed';
			              }

			              conn.onmessage = function(evt) {		 					
						try {
							data = JSON.parse(evt.data);
						}
			            catch (SyntaxError) {
			                console.log("Invalid data: " + evt.data);
			                return;
			            }
			            if (data)
			                on_msg(data);						
			              }
				console.log('Connected.');
				window.onbeforeunload = function() {
			        			 conn.onclose = function() {};
			        			 conn.close();
				}
			}
